pragma solidity >=0.6.0;

import "./ItemManager.sol";


contract Item {
    //This contract handles the payments made on Items created. Everytime you create an Item it gets its own address
    //Takes the payment and hands the payment back to the item manager
    
        uint public priceInWei;
        uint public paidWei;
        uint public index;
        
        
        ItemManager parentContract;
        

        constructor(ItemManager _parentContract, uint _priceInWei, uint _index) public {
            
            priceInWei = _priceInWei;
            index = _index;
            parentContract = _parentContract;
            
        }
        
        receive() external payable {
            require(msg.value == priceInWei, "We don't support partial payments");
            require(paidWei == 0, "Already paid for");
            paidWei += msg.value;
           (bool success, ) = address(parentContract).call.value(msg.value)(abi.encodeWithSignature("triggerPayment(uint256)", index));
           //updated syntax
           //(bool success, ) = address(parentContract).call{value: msg.value}(abi.encodeWithSignature("triggerPayment(uint256)", index));
            require(success, "Delivery did not work");
            
            
        }
        
        fallback () external {
            
        }
        
}
